import React, { Component } from 'react';
export default class About extends Component {
  render() {
    let resumeData = this.props.resumeData;
    return (
      <section id="about">
         <div className="row">

            <div className="six columns">

               <img className="profile-pic"  src="images/profilepic.jpg" alt="" />

            </div>

            <div className="six columns main-col">

               <h2>About Me</h2>
               <p>
               Turning a great game idea into a seamless and fun experience is my passion.<br></br> From designing game mechanics to developing in Unity, I can help you create a game that feels memorable and polished.
               I have 5+ years of experience in Unity and C# and have done over 15 personal and professional projects.<br></br> I am extremely comfortable with nearly all parts of the Unity engine, including 2D, 3D, and AR/VR development.<br></br>
               Services I provide:<br></br>
                  - Designing/planning game mechanics from concept<br></br>
                  - Developing in Unity (cross-platform on standalone or mobile)<br></br>
                  - Creating art and UI assets, both 2D and 3D, along with mockups<br></br>
                  - Working from and updating an existing code-base<br></br>
                  - Providing builds for QA and testing<br></br>
               I'm excited to hear about your game idea! Let's get in touch and talk about how we can work together to turn that idea into reality.
               </p>
            </div>
         </div>
      </section>
    );
  }
}
